import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post(
        'http://localhost:5000/api/login',
        { email, password },
        { withCredentials: true }
      );

      if (response.data.success) {
        localStorage.setItem('role', response.data.role);
        localStorage.setItem('user', JSON.stringify(response.data.student || {}));

        if (response.data.role === 'admin') {
          navigate('/admin_home');
        } else if (response.data.role === 'student') {
          navigate('/StudentHome');
        }
      } else {
        setError(response.data.message);
      }
    } catch (error) {
      setError('An error occurred. Please try again later.');
    }
  };

  return (
    <div style={{
      background: 'linear-gradient(to right, #6a11cb, #2575fc)',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      height: '100vh',
      color: '#fff',
      fontFamily: "'Roboto', sans-serif",
    }}>
      <div style={{
        background: '#fff',
        color: '#333',
        padding: '30px',
        borderRadius: '15px',
        boxShadow: '0 8px 20px rgba(0, 0, 0, 0.2)',
        maxWidth: '400px',
        width: '100%',
      }}>
        <h2 style={{
          fontSize: '28px',
          fontWeight: '600',
          marginBottom: '20px',
          textAlign: 'center',
          color: '#333',
        }}>
          Welcome Back
        </h2>
        <p style={{
          fontSize: '16px',
          marginBottom: '20px',
          textAlign: 'center',
          color: '#666',
        }}>
          Please log in to your account
        </p>
        <form onSubmit={handleLogin}>
          <div style={{ marginBottom: '20px' }}>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              placeholder="Email"
              required
              style={{
                width: '100%',
                padding: '12px 15px',
                border: '1px solid #ddd',
                borderRadius: '8px',
                fontSize: '16px',
                color: '#333',
                outline: 'none',
                transition: 'box-shadow 0.3s ease',
              }}
              onFocus={(e) => (e.target.style.boxShadow = '0 0 8px rgba(0, 123, 255, 0.5)')}
              onBlur={(e) => (e.target.style.boxShadow = 'none')}
            />
          </div>
          <div style={{ marginBottom: '20px' }}>
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              placeholder="Password"
              required
              style={{
                width: '100%',
                padding: '12px 15px',
                border: '1px solid #ddd',
                borderRadius: '8px',
                fontSize: '16px',
                color: '#333',
                outline: 'none',
                transition: 'box-shadow 0.3s ease',
              }}
              onFocus={(e) => (e.target.style.boxShadow = '0 0 8px rgba(0, 123, 255, 0.5)')}
              onBlur={(e) => (e.target.style.boxShadow = 'none')}
            />
          </div>
          {error && (
            <p style={{ color: 'red', fontSize: '14px', marginBottom: '15px', textAlign: 'center' }}>
              {error}
            </p>
          )}
          <button
            type="submit"
            style={{
              width: '100%',
              padding: '12px',
              background: 'linear-gradient(to right, #6a11cb, #2575fc)',
              color: '#fff',
              fontSize: '16px',
              border: 'none',
              borderRadius: '8px',
              cursor: 'pointer',
              fontWeight: '600',
              transition: 'background 0.3s ease',
            }}
            onMouseEnter={(e) => (e.target.style.background = 'linear-gradient(to right, #5a00b6, #1d62db)')}
            onMouseLeave={(e) => (e.target.style.background = 'linear-gradient(to right, #6a11cb, #2575fc)')}
          >
            Log In
          </button>
        </form>
        <p style={{
          marginTop: '20px',
          fontSize: '14px',
          color: '#666',
          textAlign: 'center',
        }}>
          Don't have an account? <a href="/register" style={{ color: '#2575fc', textDecoration: 'none' }}>Sign Up</a>
        </p>
      </div>
    </div>
  );
};

export default Login;
